\n\n<p style=\"margin-left:0; margin-right:0; text-align:justify\">O que voc&ecirc; entende por Ci&ecirc;ncia? Discuta com seus colegas o que diferencia o conhecimento popular do de Ci&ecirc;ncia.&nbsp;</p>\n\n<h1 style=\"margin-left:0px; margin-right:0px; text-align:justify\"><span style=\"color:#c0392b\"><span style=\"font-size:28px\"><span style=\"font-family:Comic Sans MS,cursive\"><strong><strong>1</strong> O que &eacute; a F&iacute;sica?</strong></span></span></span></h1>\n\n<p style=\"margin-left:0; margin-right:0; text-align:justify\">A partir do 6&ordm; ano, a disciplina Ci&ecirc;ncias ser&aacute; subdividida em seus principais componentes: a F&iacute;sica, a Qu&iacute;mica e a Biologia. Cada uma dessas novas disciplinas contribui para que a Ci&ecirc;ncia se desenvolva e novas tecnologias sejam descobertas e utilizadas no nosso dia a dia.</p>\n\n<div class=\"cx_rolagem\" ms=\"\" style=\"-webkit-text-stroke-width:0px; background-color:#ffffff; box-sizing:border-box; color:#000000\" trebuchet=\"\">\n<div class=\"bg-color-3 cx-texto-rolagem-lv\" ms=\"\" style=\"background-color:var(--cor-3); border:1px solid var(--cor-1); box-sizing:border-box\" trebuchet=\"\">\n<ul ms=\"\" style=\"box-sizing:border-box\" trebuchet=\"\">\n	<li class=\"paragrafo\" ms=\"\" style=\"box-sizing: border-box; font-weight: normal; text-decoration: none; text-indent: var(--font-padrao)  !important; font-family: \" trebuchet=\"\">A Biologia &eacute; respons&aacute;vel pelo estudo dos seres vivos e de suas caracter&iacute;sticas.</li>\n	<li class=\"paragrafo\" ms=\"\" style=\"box-sizing: border-box; font-weight: normal; text-decoration: none; text-indent: var(--font-padrao)  !important; font-family: \" trebuchet=\"\">A Qu&iacute;mica estuda a composi&ccedil;&atilde;o e as propriedades das diferentes subst&acirc;ncias que formam os corpos.</li>\n	<li class=\"paragrafo\" ms=\"\" style=\"box-sizing: border-box; font-weight: normal; text-decoration: none; text-indent: var(--font-padrao)  !important; font-family: \" trebuchet=\"\">A F&iacute;sica trata de todos os fen&ocirc;menos naturais.</li>\n</ul>\n</div>\n\n<p style=\"margin-left:0; margin-right:0; text-align:justify\">&nbsp;Tudo o que acontece na Natureza &eacute; objeto de estudo da F&iacute;sica. O movimento dos corpos ao nosso redor, a forma&ccedil;&atilde;o do arco-&iacute;ris que decora o c&eacute;u, os rel&acirc;mpagos que aparecem entre as nuvens durante as tempestades, o movimento dos astros celestes pelo Universo e o lan&ccedil;amento de foguetes ao espa&ccedil;o s&atilde;o exemplos de fen&ocirc;menos estudados pela F&iacute;sica.</p>\n\n<p style=\"margin-left:0; margin-right:0; text-align:justify\">Desde quando nascemos, temos contato com grande quantidade de fen&ocirc;menos da Natureza. Voc&ecirc;s acreditam que, com a viv&ecirc;ncia e a experi&ecirc;ncia, todos n&oacute;s conseguir&iacute;amos explicar os fen&ocirc;menos naturais, simplesmente, por meio do que observamos e, claro, por nossa intui&ccedil;&atilde;o? Certamente, isso n&atilde;o &eacute; poss&iacute;vel! A observa&ccedil;&atilde;o e a intui&ccedil;&atilde;o s&atilde;o partes importantes do processo de elabora&ccedil;&atilde;o das leis da Natureza. No entanto h&aacute; grande n&uacute;mero de acontecimentos que influenciam os fen&ocirc;menos naturais que n&atilde;o conseguimos perceber por limita&ccedil;&otilde;es dos nossos sentidos. Por isso, nossas observa&ccedil;&otilde;es e intui&ccedil;&otilde;es podem levar-nos a conclus&otilde;es precipitadas que n&atilde;o est&atilde;o de acordo com as leis da Natureza. &Eacute; importante que saibamos, exatamente, as leis cient&iacute;ficas que explicam esses acontecimentos, pois, assim, teremos condi&ccedil;&otilde;es de desenvolver tecnologias e melhorar o mundo ao nosso redor, como, por exemplo, construindo melhores m&aacute;quinas que facilitam nossas atividades di&aacute;rias.</p>\n</div>\n\n<p style=\"margin-left:0; margin-right:0; text-align:justify\">O aparecimento de problemas cada vez mais complexos exige que a tecnologia evolua na busca de m&eacute;todos e equipamentos mais sofisticados e eficazes, capazes de resolver tais problemas e de suprir as necessidades humanas. Nessa evolu&ccedil;&atilde;o, os conhecimentos adquiridos ao longo de milhares de anos de estudos e pesquisas, em todas as ci&ecirc;ncias, principalmente, a F&iacute;sica, possibilitam &agrave; sociedade compreender a Natureza e criar mecanismos, sistemas e dispositivos que melhorem nossas condi&ccedil;&otilde;es de vida.</p>','2021-02-08 11:35:36');




